import { useState } from 'react'
import Button from 'react-bootstrap/Button'
import '../index.css';

const Key = () => {
    const [key, setKey] = useState('testkey')

    const keyDivStyle = {
        display: "flex",
        justifyContent: "space-between",
        width: "100%",
    };

    const paraStyle = {
        width: "80%",  
        height: "50px", 
        border: "1px solid grey",
        borderRadius: "13px",
        textAlign: "center"
    }

    return (
        <>
            <p>Key:</p>
            <div style={keyDivStyle}>
                <div className="key-container">
                    <p id="key">{key}</p>
                </div>

                <Button>Copy</Button>
            </div>


        </>
    )
}

export default Key
